import React from 'react';

export default class Login extends React.Component {
  render() {
    return (
      <div>
        <h1>Login</h1>
        <label>
          E-mail:
          <input type="email" />
        </label>
        <label>
          Password
          <input type="password" />
        </label>
        <button>Login</button>
      </div>
    );
  }
}
